import React from 'react'
import './main.css';
import { Row, Col, Container } from 'react-bootstrap';
import test from './images/test.jpg'

const Testimonial = () => {
    return (
        <div className='Test-Module'>
        <Container >
            <p className='heading'>Testimonials</p>
          <testBlock></testBlock>
        </Container>
        </div>
    )
}
const testBlock = () => {
    return(
        <div  className='test-section'>
                    <div className='test-div'><div className='Test-img-div'><img src={test} className='Test-img' alt='Test' /></div>
                        <div class="testimonial-para">Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s,</div>
                    </div>
        </div>
    )
}
export default Testimonial;
